import Head from "next/head";
import { LayoutMainContainer } from "./style";

type TLayout = {
  title?: string;
  children: any;
};

const Layout = ({ title = "Netflix Redesign", children }: TLayout) => {
  return (
    <LayoutMainContainer>
      <Head>
        <title>{title}</title>
      </Head>

      <LayoutMainContainer>{children}</LayoutMainContainer>
    </LayoutMainContainer>
  );
};

export default Layout;
